('01e1d5c9-3506-4c7e-ac4b-d8122e8e3f6f', '<p><span style=\"color: red;\"><strong>Open Source Kit: Not available as full kit, read below for details.<br></strong></span></p><p>Introducing the Kinnara. At its heart sits the SB20PFCS30-7 8 inch paper diaphragm woofer, designed specifically for sealed enclosures. Employing low-mass foam surround enhances midrange definition, delivering exceptional transparency and very wide bandwidth.</p><p>Kinnara demonstrates the principle of a large series capacitor to sculpt the bass response of its high-Q sealed cabinet. This capacitor tuning tames the natural resonance peak and the result is well controlled bass extension with exceptional musicality.</p><p>The well behaved and exceptionally low distortion SB26ADC-C000-4 26mm Aluminum dome tweeter handles the top frequencies and integrates seamlessly to the 8 inch woofer with great phase alignment through the crossover region.</p><p>Visually, Kinnara nods to the Snell Type E with clean lines and a restrained, timeless profile. The vertically tapered enclosure effectively terminates standing waves, still, the front and side view is strictly clean and classical with no distractions.</p><p>Kinnara complements any listening environment with its understated elegance and graceful understatement. A superbly musical and enjoyable speaker that lets you forget about the equipment and simply draws you towards the musical experience.</p><p>&nbsp;</p><p><strong><em>Open Source Kit</em></strong></p><p><em>Kinnara is an open source kit meaning the speaker is fully developed and documented by SB Acoustics and you are free to use the plans.</em></p><p></p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"/products/sb26adc-c000-4\">SB26ADC-C000-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"/products/sb20pfcs30-7\">8″ SB20PFCS30-7</a></p></li></ul>', '', '', '', '', '45 – 25000 Hz', '84', '6', '105', '100 – 200 W', '2300', 'Sealed', '', 'e2e5842d-54dc-4e7b-a7a6-6bd832e8d9b0', '2025-07-31 08:35:54.170', '2025-07-31 08:37:28.502', '', 'SB26ADC-C000-4 & 8″ SB20PFCS30-7', '', '', '', '', '', '', '', ''),
('069d715e-0426-4f33-b0d6-882f0e1fb3ff', '<p>The RINJANI Be is a 2½-way floor standing speaker which takes the RINJANI performance to the highest level with the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29bn\">SATORI TW29BN</a> Beryllium tweeter and revised crossover. The TW29BN has been independently announced by many as the best tweeter in the world.</p><p>Mount Rinjani is a breathtakingly beautiful active volcano on the island of lombok, Indonesia. The volcano is know to display dramatic eruptions with plumes of lava and ash. The RINJANI kit is designed to deliver transparent and dynamic sound reproduction.</p><p>The RINJANI’s faceted baffle is specially designed to reduce high frequency diffraction and yields superb imaging qualities. A further 7° reclined cabinet ensures time alignment resulting in sublime staging and pin point placement of instruments. The quality crossover lives in it’s own sealed chamber in the bottom of the speaker with a slanted divider to diminish standing waves.</p><p>The cabinet is masterfully crafted from 18 mm MDF with internal bracing to distribute cabinet vibrations and lower sound coloration. Unwanted reflections are minimized by wedge shaped inner rear walls. The RINJANI also has dual ports at the back to distribute port resonance evenly and lower compression.</p><p>For a smaller speaker with similar design goals look to the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/ara\">ARA</a> and <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/ara-be\">ARA Be</a> which are the over achieving siblings of the great RINJANI</p><p>Please see <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}kits/open-source-kits\">Open Source Kits</a> for TeXtreme editions.</p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29bn\">Satori TW29BN</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw16p-8\">6½″ Satori MW16P-8</a></p></li></ul>', '42-30000 Hz +/-3dB', '89', '4', '107', '50-200', '2300', 'Bass reflex', '35.5', 'SATORI TW29BN & 2 x 6½″ SATORI MW16P-8', '18 mm MDF', '(HxWxD): 1010 x 190 x 464 mm ( 39.72 x 7.48 x 18.27 inch )', 'Cabinet only 18.49 kg ( 40.76 lb ), full assy 22.42 kg ( 49.43 lb )', 'e286fe46-c0fd-4fe6-a268-f9b7e0a12d6b', '2024-07-18 07:06:43.017', '2025-01-06 04:20:11.686', '', '', '', '', '', '', '', '', '', ''),
('0788dd0e-8061-4ed0-afc1-eefc4ed33961', '<p><strong>Compatibility:</strong></p><p>6½″ SATORI (all types)</p><p><strong>Materials:</strong></p><p>MDF frame with black acoustic fabric</p>', '', '', '', '', '', '', '', '', '', '', '', '', '1f4dcb0e-1e65-4fcc-bc93-3d48e4dcd5e1', '2024-07-19 04:03:57.760', '2025-01-06 05:37:22.222', '', '', '', '', '', '', '', '', '', ''),
('0c75fd88-8f36-4007-ac45-e579cc3a79ac', '<p><span style=\"color: rgb(237, 50, 55)\"><strong>Open Source Kit: Not available as full kit, read below for details.</strong></span></p><p>The SASANDU TX is a large 3-way floor standing speaker showcasing the SATORI TW29TXN-B-8 advanced TeXtreme® dome tweeter known for it’s extreme resolution and dynamics yet relaxed presentation. The midrange is covered by the 6½″ SATORI MW16TX-4 TeXtreme® cone midwoofer housed in a dedicated large sealed midrange chamber for low compression and wonderful open midrange. Each speaker is solidly anchored in the lower octaves by two 7½″ SATORI MW19TX-8 for a deep, tight and satisfyingly musical bass.</p><ul><li><p>Large 3-way floor standing speaker</p></li><li><p>Advanced TeXtreme High End SATORI drivers</p></li><li><p>Elegantly inclined cabinet for time alignment</p></li><li><p>Faceted baffle and optimized tweeter position for reduced diffraction</p></li><li><p>Slanted internal partition for reduced of standing waves</p></li><li><p>Stylish removable plinth for secure footing</p></li><li><p>Strategic internal bracing and dampening</p></li><li><p>Large low noise rear firing vent</p></li></ul><p><strong><em>Open Source Kit</em></strong></p><p><em>The SASANDU TX is an open source kit meaning the speaker is fully developed and documented by SB Acoustics and you are free to use the plans. The cabinet design is shared with the SASANDU and only the crossover of this open source kit will need to be sourced and build as DIY.</em></p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29txn-b-8\">SATORI TW29TXN-B-8</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw16tx-4\">6½″ SATORI MW16TX-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw19tx-8\">7½″ SATORI MW19TX-8</a></p></li></ul>', '', '', '', '', '', '', '32 – 32000 Hz', '89', '4', '108', '100 – 200', '400 / 2800', 'b059c81e-0bdb-4899-8b24-59854c2a6221', '2024-07-18 06:57:41.090', '2025-01-06 06:34:19.143', '', 'Bass reflex (woofer), sealed (midrange)', '', '', '', '', '32', 'SATORI TW29TXN-B-8, 6½″ inch SATORI MW16TX-4 & 7½″ SATORI MW19TX-8', '', ''),
('19c5a2a0-9ca3-42fc-ab8d-104c6f6f7229', '<p><span style=\"color: rgb(237, 50, 55)\"><strong>Open Source Kit: Not available as full kit, read below for details.</strong></span></p><p>The RINJANI TX takes advantage of the top of the line SATORI MW16TX-8 with two 6½″ midwoofers used in each speaker for a 2½-way floor standing speaker and pairs them with the 29mm wide surround TeXtreme® tweeter SATORI TW29TXN-B-8 for a visually and acoustically stunning match.</p><p>The crossover of the RINJANI TX has been completely revised for the TeXtreme® drivers to further enhance the performance and sonic qualities. the sound is very natural and true to life with the two 6½″ Mid woofers speaker delivering accurate and solid bass at even high listening levels.</p><p>The RINJANI’s faceted baffle is specially designed to reduce high frequency diffraction an yields superb imaging qualities. The 7 reclined cabinet ensures good time alignment resulting in sublime staging and pin point placement of instruments. the quality crossover lives in it’s own sealed chamber in the bottom of the speaker with a slanted divider to diminish standing waves.</p><p><strong><em>Open Source Kit</em></strong></p><p><em>The RINJANI TX is an open source kit meaning the speaker is fully developed and documented by SB Acoustics and you are free to use the plans. The cabinet design is shared with the RINJANI and RINJANI Be, only the crossover of this open source kit will need to be sourced and build as DIY.</em></p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29txn-b-8\">SATORI TW29TXN-B-8</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw16tx-8\">6½″ SATORI MW16TX-8</a></p></li></ul>', '', '', '', '', '45 – 32000 Hz', '88', '4', '106', '50 – 200', '2400', 'Bass reflex', '35.5', 'c7e7a335-25e3-4cb7-be04-98bcbd22c720', '2024-07-18 06:55:48.150', '2025-01-06 06:34:05.890', '', 'SATORI TW29TXN-B-8 & 6½″ SATORIMW16TX-8', '', '', '', '', '', '', '', ''),
('1eccc734-9e4c-44d9-8ba5-8bda015449b5', '<p>With the same external dimensions as the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/micro\">MICRO</a>, the MICRO-C features the high-end <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb12cacs25-4\">4″ SB12CAC</a> ceramic cone midwoofer for truly exhilarating sound experiences. This speaker is capable of unbelievable detail and packs a real punch in the bass. We are enjoyed when we see peoples faces light up from the surprise of the musicality of this great speaker.</p><p><strong>Features:</strong></p><ul><li><p>High performance compact design</p></li><li><p>High End ceramic midwoofer</p></li><li><p>High quality cross-over</p></li><li><p>Front firing slot port</p></li><li><p>Versatile placement</p></li><li><p>Solid single-wiring binding posts</p></li></ul><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb19st-c000-4\">SB19ST-C000-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb12cacs25-4\">4″ SB12CACS25-4</a></p></li></ul>', '68-28000 Hz +/-3 dB', '84.5', '4', '100', '25-100', '4000', 'Bass reflex', '49', 'SB19ST-C000-4 & 4″ SB12CACS25-4', '15 mm MDF', '(HxWxD):  262 x 132 x 170 mm ( 10.3 x 5.2 x 6.7 inch )', 'Cabinet only 4.3 kg ( 9.48 lb ), full assy 7.8 kg ( 17.2 lb )', 'b6ee5250-51ae-4668-be49-ea76910e77e0', '2024-07-18 07:09:32.354', '2025-01-06 04:18:00.952', '', '', '', '', '', '', '', '', '', ''),
('26bb1add-72f5-4027-b6bc-2c7a9f5dad90', 'The first commercial kit developed by SB Acoustics. Eka means ‘First son’ the firstborn always emanates special emotions and we feel the same way about Eka. It is a 2-way wooden veneer, or painted speaker with a paper cone 6″ mid-woofer and a 26mm soft dome. This combination works exceptionally well and you get a surprisingly high performance/price ratio. The woofer is a paper pulp cone made in house. You could claim paper is not the newest invention in cone material, true, but optimized correctly paper is an incredibly effective material and as we make it, we control the quality. The low-end performance of this small speaker is very impressive; a deep, controlled and firm system. The 26-mm dome – SB26STAC keeps on impressing when used in real high-end solutions. Smooth, airy and low distortion are just some of the words used to describe this dome and the treble performance of Eka.\n\nThe cabinet:\n\nHigh quality 18mm MDF with internal bracing to minimize vibrations. Finish: Walnut, Ebony and black paint, all with deep High-Gloss finish.', '49-25000 Hz', '66.5 dB', '4Ω', '105 dB', '40 – 150 W', '3100 Hz', 'Bass reflex', '37 Hz', 'Soft Dome SB26STAC-C000-4 & 6″ SB17NRXC35-4', '18mm MDF', '(HxWxD) 340 x 330 x 200 mm ( 13.4 x 13 x 7.9 inch )', 'Cabinet Only 6.91 Kg ( 15.23 lb ) , Full Assy 9.0 Kg ( 19.84 lb )', 'undefined', '2024-07-18 06:36:24.072', '2024-07-18 06:36:24.072', '', '', '', '', '', '', '', '', '', ''),
('316d1384-4566-46fa-93d6-7e52f67b0769', '<p></p>', '', '89', '4', '', '', '', '', '', '', '', '', '0.014', 'a3292080-0a8a-4a37-a189-f8755cdf4900', '2024-07-23 08:23:45.645', '2025-01-06 05:43:39.511', '1.5', '3', '1300', '0.003', '1.05', '10', '12.4', '1.2', '* IEC 268-5, T/S parameters measured on drive units that are broken in.', 'Fabric'),
('33e79de4-fc9b-4838-83f6-209cc988967c', '<p><strong>Compatibility:</strong></p><p>7½″ SATORI (all types)</p><p><strong>Materials:</strong></p><p>MDF frame with black acoustic fabric</p>', '', '', '', '', '', '', '', '', '', '', '', '', 'e8b34f6a-9ab3-43bd-b822-f1e5b552abe5', '2024-07-19 04:04:28.782', '2025-01-06 05:37:07.770', '', '', '', '', '', '', '', '', '', ''),
('34e59a23-0026-4d66-93ab-258d63d4e60c', '<p><strong>Compatibility:</strong></p><p>5″ SATORI (all types)</p><p><strong>Materials:</strong></p><p>MDF frame with black acoustic fabric</p>', '', '', '', '', '', '', '', '', '', '', '', '', '1319bdfe-f987-4bef-8b9b-846cb741ee80', '2024-07-19 04:03:24.124', '2025-01-06 05:37:33.662', '', '', '', '', '', '', '', '', '', ''),
('351a5730-37a7-4b1a-bbd7-18d03aad131e', '<p>The ARYA is a floor standing 2½-way speaker kit. Arya means “wise man” and we believe Arya is the wise choice if you want an elegant hih performance floor standing speaker.</p><p>Each speaker uses tow <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb17mfc35-8\">6″ SB17MFC</a> mineral filled poly cone woofers for a tight satisfying bass and clean crisp mids. The SB Acoustics mineral filled poly cones are of a special composition and we are confident poly cones have never sounded better.</p><p>With 2 x 6″ woofers per side there is enough quality bass for room sizes of 50m2/500f2 or more. The tweeter is the very renowned and patented <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb29rdac-c000-4\">Ring Dome</a>. the large 29mm dome with centre termination and wide ultra linear suspension results in a very low distortion and a presentation that can be described as very “silent/black” background.</p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb29rdac-c000-4\">SB29RDAC-C000-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb17mfc35-8\">6″ SB17MFC35-8</a></p></li></ul>', '44-28000 Hz +/-3 dB', '87.5', '4', '107', '50 – 200', '3000', 'Bass reflex', '41', 'SB29RDAC-C000-4 & 6″ SB17MFC35-8', '18 mm MDF', '(HxWxD): 1076 x 195 x 310 mm ( 42.36 x 7.68 x 12.2 inch )', 'Cabinet only 18.73 kg ( 41.29 lb ), full assy 22.54 kg ( 49.69 lb )', 'f1bf569a-8fe8-476d-bb03-aa12173a4d8c', '2024-07-18 07:03:37.858', '2025-01-06 04:21:52.216', '', '', '', '', '', '', '', '', '', ''),
('397b2bd5-2d83-4c20-b02b-5563aab42049', '<p></p>', '', '89', '4', '', '', '', '', '', '', '', '', '0.014', '3959902d-370d-44ca-bfd7-5df2b0dccc9a', '2024-07-23 08:34:18.357', '2025-01-06 05:48:56.681', '1.5', '3', '1300', '0.003', '1.05', '10', '12.4', '1.2', '', 'Fabric'),
('55779798-9705-4f1c-93c0-e7d4771446c1', '<p><span style=\"color: red\"><strong>Open Source Kit: Not available as full kit, read below for details.<br></strong></span></p><p>Tifa 8 is an impressive 3 way floor-standing speaker staying true to the unique Danish design language of the Tifa family. The Tifa 8 features a dedicated 6-inch natural fiber cone midrange housed in it’s own sealed midrange chamber. The highest octaves are handed off to the 26mm fine weave fabric soft dome known for it’s undistorted smooth and dynamic sound.</p><p>Dual 8-inch woofer anchor the lower frequencies with deep, tight bass. The Tifa inclined cabinet design optimizes driver time alignment, offering precise imaging. Crafted with precision, the robust MDF construction and strategic bracing minimize vibrations, providing a pure, uncolored listening experience.</p><p>&nbsp;</p><p><strong><em>Open Source Kit</em></strong></p><p><em>Tifa 8 is an open source kit meaning the speaker is fully developed and documented by SB Acoustics and you are free to use the plans.</em></p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb26st-c000-5\">SB26ST-C000-5</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb13pfcr25-8\">5″ SB13PFCR25-8</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb20pfcr30-4\">8″ SB20PFCR30-4</a></p></li></ul>', '', '', '', '', '38 – 26000 Hz', '87.5', '8', '108', '50 – 200 W', '400/2600 Hz', 'Bass reflex (woofer), sealed (midrange)', '40', 'f5479ee0-54e0-47d8-9444-11f303820001', '2025-05-23 07:31:00.078', '2025-05-23 07:51:27.368', '', 'SB26ST-C000-5, 5″ SB13PFCR25-8 & 8″ SB20PFCR30-4', '', '', '', '', '', '', '', ''),
('6096a54f-dd9b-4af2-8b11-4dd800b00199', '<p><span style=\"color: rgb(237, 50, 55)\"><strong>Open Source Kit: Not available as full kit, read below for details.</strong></span></p><p>The ARA TX features the top of the line TeXtreme® midwoofer SATORI MW16TX-4 and pairs it with the TeXtreme® tweeter SATORI TW29TXN-8 for a visually and acoustically stunning match.</p><p>Compared to the ARA and ARA Be the crossover topology is realised differently on the ARA TX. In the low frequency section there is only one single component directly in series with the signal path to the 6½″ SATORI MW16TX-4. This series inductor is followed by a number of parallel LCR-networks to further shape the response and for break up control as well as perfect integration to the 29mm Textreme® tweeter and optimised tweeter network.</p><p>The result is very open and transparent sound that is both natural and very relaxed. The bass is deep and very convincing for a stand mount speaker.</p><p>The ARA’s faceted baffle is specially designed to reduce high frequency diffraction and yields superb imaging qualities. The 7° reclined cabinet ensures good time alignment resulting in sublime staging and pin point placement of instruments.</p><p><strong><em>Open Source Kit</em></strong></p><p><em>The ARA TX is an open source kit meaning the speaker is fully developed and documented by SB Acoustics and you are free to use the plans. The cabinet design is shared with the ARA and ARA Be, only the crossover of this open source kit will need to be sourced and build as DIY.</em></p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29txn-b-8\">SATORI TW29TXN-B-8</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw16tx-4\">6½″ SATORI MW16TX-4</a></p></li></ul>', '', '', '', '', '45 – 32000 Hz', '87', '4', '105', '40 – 150', '2500', 'Bass reflex', '36.5', 'd38b8147-d68e-4d04-953a-3dd02231af99', '2024-07-18 06:54:27.357', '2025-01-06 06:33:48.565', '', 'SATORI TW29TXN-B-8 & 6½″ SATORI MW16TX-4', '', '', '', '', '', '', '', ''),
('62f048b6-c8c7-4119-b28e-3999ef2d67b2', 'The first commercial kit developed by SB Acoustics. Eka means ‘First son’ the firstborn always emanates special emotions and we feel the same way about Eka. It is a 2-way wooden veneer, or painted speaker with a paper cone 6″ mid-woofer and a 26mm soft dome. This combination works exceptionally well and you get a surprisingly high performance/price ratio. The woofer is a paper pulp cone made in house. You could claim paper is not the newest invention in cone material, true, but optimized correctly paper is an incredibly effective material and as we make it, we control the quality. The low-end performance of this small speaker is very impressive; a deep, controlled and firm system. The 26-mm dome – SB26STAC keeps on impressing when used in real high-end solutions. Smooth, airy and low distortion are just some of the words used to describe this dome and the treble performance of Eka.\n\nThe cabinet:\n\nHigh quality 18mm MDF with internal bracing to minimize vibrations. Finish: Walnut, Ebony and black paint, all with deep High-Gloss finish.', '49-25000 Hz', '66.5 dB', '4Ω', '105 dB', '40 – 150 W', '3100 Hz', 'Bass reflex', '37 Hz', 'Soft Dome SB26STAC-C000-4 & 6″ SB17NRXC35-4', '18mm MDF', '(HxWxD) 340 x 330 x 200 mm ( 13.4 x 13 x 7.9 inch )', 'Cabinet Only 6.91 Kg ( 15.23 lb ) , Full Assy 9.0 Kg ( 19.84 lb )', 'undefined', '2024-07-18 06:45:39.303', '2024-07-18 06:45:39.303', '', '', '', '', '', '', '', '', '', ''),
('64e84920-6253-4037-afb6-64c9b707d2c8', '<p>The MICRO is a compact 2-way speaker kit with minimal footprint and ideally suited for bookshelf placement, desktop or even near field monitoring. Treat yourself with far better sound than comparable pre-assembled consumer speakers can offer. These small but capable speakers are sure to impress and will easily fill your favorite listening space with high quality sound.</p><p><strong>Features:</strong></p><ul><li><p>Compact design</p></li><li><p>Aluminum cone midwoofer</p></li><li><p>Simple high quality cross-over network</p></li><li><p>Front firing integrated port</p></li><li><p>Versatile placement</p></li><li><p>Solid single-wiring binding posts</p></li></ul><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb19st-c000-4\">SB19ST-C000-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb12pac25-4\">4″ SB12PAC25-4</a></p></li></ul>', '70-28000 Hz +/-3 dB', '84.5', '4', '100', '25-100', '4000', 'Bass reflex', '49', 'SB19ST-C000-4 & 4″ SB12PAC25-4', '15 mm MDF', '(HxWxD):  260 x 130 x 170 mm ( 10.2 x 5.1 x 6.7 inch )', 'Cabinet only 4.2 kg ( 9.25 lb ), full assy 7.4 kg ( 16.32 lb )', 'e5258eb1-04ca-4670-9778-42c53ff99fef', '2024-07-18 07:04:58.150', '2025-01-06 04:21:35.846', '', '', '', '', '', '', '', '', '', ''),
('78748f18-f5a3-4fb1-84bd-401423fa64d3', '<p><strong>Compatibility:</strong></p><p>9½″ SATORI (all types)</p><p><strong>Materials:</strong></p><p>MDF frame with black acoustic fabric</p>', '', '', '', '', '', '', '', '', '', '', '', '', 'e7917dcf-bdbd-432e-8416-1333eaa0fc6d', '2024-07-19 04:04:56.723', '2025-01-06 05:36:46.516', '', '', '', '', '', '', '', '', '', ''),
('870b0163-257e-4da2-bcd3-6761c4f4d350', '<p>The ARA Be is a 2-way stand mount kit which takes the ARA performance to the highest level with the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29bn\">SATORI TW29BN</a> Beryllium tweeter and revised crossover. The TW29BN has been independently announced by many as the best tweeter in the world.</p><p>ARA is the highest point of komodo Island in Indonesia and particularly notable as the habitat of the spectacular and mythical Komodo dragons. The ARA kit is designed to deliver top level transparent and dynamic sound reproduction</p><p>The ARA’s faceted baffle is specially designed to reduce high frequency diffraction and yields superb imaging qualities. A further 7° reclined cabinet ensures time alignment resulting in sublime staging and pin point placement of instruments.</p><p>The cabinet is masterfully crafted from 18 mm MDF with internal bracing to distribute cabinet vibrations and lower sound coloration. Unwanted reflection are minimized by wedge shaped inner rear walls. the ARA has a large rear firing port and high quality speaker terminals on a solid aluminum binding post plate.</p><p>For a larger speaker with similar design goals look to the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/rinjani\">RINJANI</a> and <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/rinjani-be\">RINJANI Be</a> which are the larger floor standing siblings of the ARA.</p><p>Please see <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}kits/open-source-kits\">Open Source Kits</a> for TeXtreme editions.</p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29bn\">Satori TW29BN</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw16p-4\">6½″ Satori MW16P-4</a></p></li></ul>', '45-30000 Hz +/-3dB', '87', '4', '105', '40-150', '2300', 'Bass reflex', '36.5', 'SATORI TW29BN & 6½″ SATORI MW16P-4', '18 mm MDF', '(HxWxD): 391 x 190 x 388 mm ( 15.4 x 7.48 x 15.27 inch )', 'Cabinet only 8.06 kg ( 17.77 lb ), full assy 9.6 kg ( 21.16 lb )', '1c75ecd3-003e-4c86-a8c3-6a3788abea4c', '2024-07-18 07:07:57.898', '2025-01-06 04:18:57.598', '', '', '', '', '', '', '', '', '', ''),
('8a4fdc90-f142-448b-95d9-9de162d6081f', '<p></p>', '', '89', '4', '', '', '', '', '', '', '', '', '0.014', '57c2c915-77c8-489a-ae1f-1ea2c6d9f1ce', '2024-07-23 08:27:47.243', '2025-01-06 05:48:16.953', '1.5', '3', '1300', '0.003', '1.05', '10', '12.4', '1.2', '* IEC 268-5, high-pass Butterworth, 3.5 Hz, 12 dB/oct.', 'Fabric'),
('99d019cb-c6e4-446f-bc7e-f25356ed68fa', '<p>The RINJANI is a 2½-way floor standing speaker kit built with top-line SATORI drivers. Each speaker is equipped with two <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw16p-8\">SATORI 6½″ Papyrus</a> cone midwoofers and the famous <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29r\">SATORI TW29R</a> Ring-dome tweeter.</p><p>Mount Rinjani is a breathtakingly beautiful active volcano on the island of lombok, Indonesia. The volcano is know to display dramatic eruptions with plumes of lava and ash. The RINJANI kit is designed to deliver transparent and dynamic sound reproduction.</p><p>The RINJANI’s faceted baffle is specially designed to reduce high frequency diffraction and yields superb imaging qualities. A further 7° reclined cabinet ensures time alignment resulting in sublime staging and pin point placement in instruments. The quality crossover lives in it’s own sealed chamber in the bottom of the speaker with a slanted divider to diminish standing waves.</p><p>The cabinet is masterfully crafted from 18 mm MDF with internal bracing to distribute cabinet vibrations and lower sound coloration. Unwanted reflections are minimized by wedge shaped inner rear walls. The RINJANI also has dual ports at the back to distribute port resonance evenly and lower compression.</p><p>For a smaller speaker with similar design goals look to the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/ara\">ARA</a> and <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/ara-be\">ARA Be</a> which are the over achieving siblings of the great RINJANI.</p><p>Please see <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}kits/open-source-kits\">Open Source Kits</a> for TeXtreme editions.</p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29r\">Satori TW29R</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw16p-8\">6½″ Satori MW16P-8</a></p></li></ul>', '42-25000 Hz +/-3dB', '89', '4', '107', '50-200', '3000', 'Bass reflex', '35.5', 'SATORI TW29R & 2 x 6½″ SATORI MW16P-8', '18 mm MDF', '(HxWxD): 1010 x 190 x 464 mm ( 39.72 x 7.48 x 18.27 inch )', 'Cabinet only 18.49 kg ( 40.76 lb ) , full assy 22.42 kg ( 49.43 lb )', '3e676384-e6a1-4777-b03f-6f4d9fcb68c5', '2024-07-18 07:00:56.346', '2025-01-06 04:22:34.530', '', '', '', '', '', '', '', '', '', ''),
('a1b816bf-08f6-4679-a3ed-08a34039b38d', 'The first commercial kit developed by SB Acoustics. Eka means ‘First son’ the firstborn always emanates special emotions and we feel the same way about Eka. It is a 2-way wooden veneer, or painted speaker with a paper cone 6″ mid-woofer and a 26mm soft dome. This combination works exceptionally well and you get a surprisingly high performance/price ratio. The woofer is a paper pulp cone made in house. You could claim paper is not the newest invention in cone material, true, but optimized correctly paper is an incredibly effective material and as we make it, we control the quality. The low-end performance of this small speaker is very impressive; a deep, controlled and firm system. The 26-mm dome – SB26STAC keeps on impressing when used in real high-end solutions. Smooth, airy and low distortion are just some of the words used to describe this dome and the treble performance of Eka.\n\nThe cabinet:\n\nHigh quality 18mm MDF with internal bracing to minimize vibrations. Finish: Walnut, Ebony and black paint, all with deep High-Gloss finish.', '49-25000 Hz', '66.5 dB', '4Ω', '105 dB', '40 – 150 W', '3100 Hz', 'Bass reflex', '37 Hz', 'Soft Dome SB26STAC-C000-4 & 6″ SB17NRXC35-4', '18mm MDF', '(HxWxD) 340 x 330 x 200 mm ( 13.4 x 13 x 7.9 inch )', 'Cabinet Only 6.91 Kg ( 15.23 lb ) , Full Assy 9.0 Kg ( 19.84 lb )', 'undefined', '2024-07-18 06:37:19.322', '2024-07-18 06:37:19.322', '', '', '', '', '', '', '', '', '', ''),
('a227e785-5071-4e15-8803-cccfe8c39aa3', 'The first commercial kit developed by SB Acoustics. Eka means ‘First son’ the firstborn always emanates special emotions and we feel the same way about Eka. It is a 2-way wooden veneer, or painted speaker with a paper cone 6″ mid-woofer and a 26mm soft dome. This combination works exceptionally well and you get a surprisingly high performance/price ratio. The woofer is a paper pulp cone made in house. You could claim paper is not the newest invention in cone material, true, but optimized correctly paper is an incredibly effective material and as we make it, we control the quality. The low-end performance of this small speaker is very impressive; a deep, controlled and firm system. The 26-mm dome – SB26STAC keeps on impressing when used in real high-end solutions. Smooth, airy and low distortion are just some of the words used to describe this dome and the treble performance of Eka.\n\nThe cabinet:\n\nHigh quality 18mm MDF with internal bracing to minimize vibrations. Finish: Walnut, Ebony and black paint, all with deep High-Gloss finish.', '49-25000 Hz', '66.5 dB', '4Ω', '105 dB', '40 – 150 W', '3100 Hz', 'Bass reflex', '37 Hz', 'Soft Dome SB26STAC-C000-4 & 6″ SB17NRXC35-4', '18mm MDF', '(HxWxD) 340 x 330 x 200 mm ( 13.4 x 13 x 7.9 inch )', 'Cabinet Only 6.91 Kg ( 15.23 lb ) , Full Assy 9.0 Kg ( 19.84 lb )', 'undefined', '2024-07-18 06:38:37.879', '2024-07-18 06:38:37.879', '', '', '', '', '', '', '', '', '', ''),
