('a97d818b-833b-4b9a-ab8b-b130a8afeb0f', '<p><strong>Features:</strong></p><p>Standard weight block designed to adjust the moving mass of SB Acoustics passive radiators.</p><p><strong>Specs:</strong></p><ul><li><p>Mass: 50 g</p></li><li><p>Material: Aluminum</p></li></ul>', '', '', '', '', '', '', '', '', '', '', '', '', '25848156-0bb7-4293-8f99-4dcc8ffb6eeb', '2024-07-19 03:46:39.153', '2025-03-21 09:07:33.625', '', '', '', '', '', '', '', '', '', ''),
('a9d67a9b-ea0f-4bb0-853d-c957a88a1048', '<p><strong>Compatibility:</strong></p><p>SATORI TW29 (all types)</p><p><strong>Materials:</strong></p><p>MDF frame with black acoustic fabric</p>', '', '', '', '', '', '', '', '', '', '', '', '', '826d9312-aecc-4e85-b933-673bc349eb15', '2024-07-19 04:02:21.889', '2025-01-06 05:37:44.222', '', '', '', '', '', '', '', '', '', ''),
('b03031da-8122-4c80-b55d-3ec138237bd3', '<p><span style=\"color: red\"><strong>Open Source Kit: Not available as full kit, read below for details.<br></strong></span></p><p>The playful design of the Tifa 6 follows in the footsteps of the renowned Danish engineered SB Acoustics speakers. The sound is open and transparent, free from unwanted standing waves and reflection thanks to the elegantly slanted cabinet.</p><p>The Tifa 6 is true HiFi in a small package and fits perfectly in any living room. The sound presents as very natural, articulate and refined yet with a warm character with satisfying bass thanks to the natural fiber cone 6-inch midwoofer paired with our 26mm fine weave soft fabric dome tweeter.</p><p>&nbsp;</p><p><strong><em>Open Source Kit</em></strong></p><p><em>Tifa 6 is an open source kit meaning the speaker is fully developed and documented by SB Acoustics and you are free to use the plans.</em></p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb26st-c000-5\">SB26ST-C000-5</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb16pfcr25-4\">6″ SB16PFCR25-4</a></p></li></ul>', '', '', '', '', '36 – 26000 Hz', '85', '4', '105', '50 – 150 W', '2600', 'Bass reflex', '37', 'f90dd744-317e-4a6f-b4c5-d7c02270c198', '2025-05-23 07:38:33.177', '2025-05-23 07:46:18.676', '', 'SB26ST-C000-5 & 6\" SB16PFCR25-4', '', '', '', '', '', '', '', ''),
('b81edee7-7795-4c42-9359-86092a5f931e', '<p></p>', '', '87.5', '4', '', '', '', '', '', '', '', '', '0.014', '314a945f-4940-450e-8a42-d50a2a1fee75', '2024-07-23 08:30:10.915', '2025-01-06 05:49:28.535', '1.5', '3', '1300', '0.003', '0.97', '10', '12.4', '1.2', '', 'Fabric'),
('c5dc6fb5-8375-4602-9da2-6ef5b0b0d223', '<p><span style=\"color: rgb(237, 50, 55)\"><strong>Open Source Kit: Not available as full kit, read below for details.</strong></span></p><p>Bromo is an active volcano in East Java, Indonesia and the name Bromo is derived from The Hindu creator of God. The aspirations of this speaker are clearly set very high.</p><p>It is a 2-way ported compact speaker showcasing hard cone material diaphragms. The drivers are known for very high performance, low distortion and unique price-performance ratio. The NBAC (aluminum) midwoofers and CAC (ceramic) woofers can both be used with the same crossover designed for this speaker. The tweeter ADC (aluminum) and CDC (ceramic) are also interchangeable. Though the specifications are similar, both setups are audibly different. The ceramic diaphragm drivers adds a step up in clarity to most ears.</p><p>This is a hard cone/dome speaker but without the typical ‘issues’ as audible breakups of the mid-woofer and the tweeter never get too harsh on the ears. This SB Acoustics developed speaker lowers coloration through a braced cabinet with minimised and evenly distributed vibrations of the MDF panels. The speaker is nicely detailed and more ‘punchy’ than that was expected from this cabinet size. The speakers were showcased at the Axpona Show 2019 in Chicago and received overwhelming positive feedback.</p><p><strong><em>Open Source Kit</em></strong></p><p><em>This means SB Acoustics has developed this kit, build it, tested it and is proud of the performance. All development details are available online, including crossover schematics, but SB Acoustics will not supply cabinets and finished crossover for open source kits.</em></p><p><em>Builders have the freedom to choose their preferred crossover components. Thus, be aware any changes of components, will change the performance from its ‘original’ sound.</em></p><p><strong>Drivers:</strong></p><p>Ceramic cone option:</p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb26cdc-c000-4\">SB26CDC-C000-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb17cac35-4\">6″ SB17CAC35-4</a></p></li></ul><p>Aluminum cone option:</p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb26adc-c000-4\">SB26ADC-C000-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb17nbac35-4\">6″ SB17NBAC35-4</a></p></li></ul>', '', '', '', '', '45 – 24000 Hz', '84', '5', '105', '50 – 150', '3000', 'Bass reflex', '38', 'd74b797f-7d6c-4234-b146-ca2e452d6e1c', '2024-07-18 06:51:53.794', '2025-01-06 06:35:01.165', '', 'SB26CDC-C000-4 & 6″ SB17CAC35-4', '', '', '', '', '', '', '', ''),
('d1e6513c-2505-4676-b4f8-5629ede36b44', '<p></p>', '', '89', '4', '', '', '', '', '', '', '', '', '0.014', 'ffacf733-e64d-4c02-99b8-2f3bc6714ae3', '2024-07-23 08:25:51.104', '2025-01-06 05:48:05.988', '1.5', '3', '1300', '0.003', '1.05', '10', '12.4', '1.2', '* IEC 268-5, high-pass Butterworth, 3 kHz, 12 dB/oct.', 'Fabric'),
('df96791a-f5c2-446b-91c4-af85089fe43a', '<p>The first commercial kit developed by SB Acoustics. Eka means ‘First son’ the firstborn always emanates special emotions and we feel the same way about Eka. It is a 2-way wooden veneer, or painted speaker with a paper cone 6″ mid-woofer and a 26mm soft dome. This combination works exceptionally well and you get a surprisingly high performance/price ratio. The woofer is a paper pulp cone made in house. You could claim paper is not the newest invention in cone material, true, but optimized correctly paper is an incredibly effective material and as we make it, we control the quality. The low-end performance of this small speaker is very impressive; a deep, controlled and firm system. The 26-mm dome – SB26STAC keeps on impressing when used in real high-end solutions. Smooth, airy and low distortion are just some of the words used to describe this dome and the treble performance of Eka.</p><p><strong>The cabinet:</strong></p><p>High quality 18mm MDF with internal bracing to minimize vibrations. Finish: Walnut, Ebony and black paint, all with deep High-Gloss finish.</p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb26stac-c000-4\">SB26STAC-C000-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb17nrxc35-4\">6″ SB17NRXC35-4</a></p></li></ul>', '49-25000 Hz', '66.5', '4', '105', '40 – 150', '3100', 'Bass reflex', '37', 'Soft Dome SB26STAC-C000-4 & 6″ SB17NRXC35-4', '18mm MDF', '(HxWxD) 340 x 330 x 200 mm ( 13.4 x 13 x 7.9 inch )', 'Cabinet Only 6.91 Kg ( 15.23 lb ) , Full Assy 9.0 Kg ( 19.84 lb )', '20449ecf-5594-4a83-8a4b-5e4197d787e3', '2024-07-18 06:46:52.003', '2025-01-06 05:36:28.574', '', '', '', '', '', '', '', '', '', ''),
('e2a238ee-fb9c-4179-9a4d-c834424e910d', '<p>Gema is a large 3-way speaker paying homage to the classic speaker of the 1970’s. Generous enclosure proportions fitted with large bass drivers were the bee’s knees at the time. And for good reason! The Gema is our take on a retro-styled speaker, and the much loved 12″ SB34NRXL75-8 lays the foundation of a deep, well controlled and tuneful bassline.</p><p>The dedicated midrange is covered from 680Hz and all the way up to 3kHz by the 4″ paper cone SB12MNRX2-25-4 which is characterized by good efficiency, low moving mass and great linearity resulting in excellent midrange clarity.</p><p>To perfectly match the articulate and open midrange the top end is handed over to the 1 inch soft dome SB26STAC-c000-4 equipped with die-cast aluminium faceplate, optimised rear chamber and full copper cap.</p><p>The well braced cabinet is designed with a large slot port tuned to 28 Hz opening to the front of the speaker and a generous sealed enclosure for the dedicated midrange. We highly recommend building the speakers from high quality 18mm plywood.</p><p>A good starting point for the placement of the Gema would be a spacing of 2.5-3 meters between the speakers with generous clearance to any side and rear walls and ideally on a stand or plinth elevating the speaker about 25cm from the floor and tilted back at about 6 degrees and a slight toe in. The tweeter and midrange are intended to be on the outside, but this will depend on the room – as usual, we encourage you to experiment with speaker placement to suit your taste and listening space.</p><p><strong><em>Open Source Kit</em></strong></p><p><em>Gema is an open source kit meaning the speaker is fully developed and documented by SB Acoustics and you are free to use the plans.</em></p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb26stac-c000-4\">SB26STAC-C000-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb12mnrx2-25-4\">4″ SB12MNRX2-25-4</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/sb34nrxl75-8\">12″ SB34NRXL75-8</a></p></li></ul>', '', '', '', '', '', '', '36 – 24000 Hz', '87', '6', '108', '50 – 200', '680 / 3000', '5794887a-cf7a-4805-887a-e3a87a0b78ad', '2024-07-18 06:59:17.933', '2025-05-28 06:33:13.483', '', 'Bass reflex', '', '', '', '', '28', 'SB26STAC-C000-4, 4″ SB12MNRX25-4 & 12″ SB34NRXL75-8', '', ''),
('eb5e1273-665d-4bc0-bdfe-eeaca0487be7', '<p></p>', '', '89', '4', '', '', '', '', '', '', '', '', '0.014', 'fa06264e-00d5-4adf-95b8-51258f40b6c1', '2024-07-23 08:32:39.529', '2025-01-06 05:49:13.595', '1.5', '3', '1300', '0.003', '1.05', '10', '12.4', '1.2', '', 'Fabric'),
('eda3fc24-eb8e-432d-95e1-4a44a636ab85', '<p></p>', '', '90', '4', '', '', '', '', '', '', '', '', '0.083', 'fbc9d4d9-ebd0-48eb-9109-adacec484983', '2024-07-23 08:37:24.619', '2025-01-06 05:48:30.968', '2.5', '3.7', '1200', '0.016', '1.2', '60', '25.4', '1.3', '', 'Fabric'),
('f2705f6f-3feb-41c4-8ddc-7abfdfb6e897', '<p>The SASANDU is a large 3-way floor standing speaker showcasing the advanced SATORI 29mm Neodymium Beryllium tweeter. The midrange is covered by the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mr16p-4\">6½″ SATORI MR16P-4</a> Egyptian Papyrus cone midrange with a dedicated large sealed midrange chamber for low compression and wonderful open midrange reproduction. Each speaker is solidly anchored in the lower octaves by two <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw19p-8\">7½″ SATORI MW19P-8</a> for a deep, tight, and satisfyingly musical bass.</p><p>SASANDU also called Sasando means “sounded instrument” and is a traditional Indonesian harp like string instrument with a body made from bamboo and native type of leaves. The SASANDU is a no compromise speaker kit designed to reproduce music as faithfully as possible.</p><p>The SASANDU’s faceted baffle and optimized tweeter position to lower diffraction as well as inclined cabinet to time align the drivers result in state of the art imaging. The large high quality crossover has it’s own chamber behind the removable plinth.</p><p>The cabinet is masterfully crafted from 28, 18, and 15 mm MDF with strategic internal bracing to distribute cabinet vibrations and lower sound coloration. A slanted internal partition reduces internal standing waves and the over size 75 mm port at the rear ensures uncompressed bass even at very high listening levels.</p><p>Please see <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}kits/open-source-kits\">Open Source Kits</a> for TeXtreme editions.</p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29bn-b-8\">SATORI TW29BN-B-8</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mr16p-4\">6½″ SATORI MR16P-4</a></p></li><li><p>2 X <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw19p-8\">7½″ SATORI MW19P-8</a></p></li></ul>', '32-32000 Hz +/-3 dB', '89', '4', '108', '100-200', '480 / 2800', 'Bass reflex (woofers), sealed (midrange)', '32', 'SATORI TW29BN-B-8, 6½″ SATORI MR16P-4, 2 x 7½″ SATORI MW19P-8', '28, 18, 15 mm MDF', '1100 x 230 x 615 mm (43.3 x 9.0 x 24.2 inch)', '32.5 kg', '0ec4f7f4-7826-41d8-89d6-d92130988be3', '2024-07-18 07:11:09.597', '2025-01-06 04:13:27.176', '', '', '', '', '', '', '', '', '', ''),
('f3499a74-3e46-42b9-83cb-0bfdcfe3e913', '<p><strong>ARA</strong>, the smaller brother of <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/rinjani\">RINJANI</a>, reflecting the same design concept. The ARA is a 2-way stand mount speaker kit based on the excellent SATORI drivers <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw16p-4\">6½″ MW16P</a> Papyrus cone midwoofers and the famous <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29r-b\">SATORI TW29R</a> Ring-dome tweeter.</p><p>ARA is the highest point of Komodo Island in Indonesia and particularly notable as the habitat of the spectacular and mythical komodo dragons. The ARA kit is designed to deliver top level transparent and dynamic sound reproduction.</p><p>The ARA’s faceted baffle is specially designed to reduce high frequency diffraction and yield superb imaging qualities. A further 7° reclined cabinet ensures time alignment resulting in sublime staging and pin point placement of instruments.</p><p>The cabinet is masterfully crafted from 18 mm MDF with internal bracing to distribute cabinet vibrations and lower sound coloration. Unwanted reflections are minimized by wedge shaped inner rear walls. The ARA has a large rear firing port and high quality speaker terminals on a solid aluminium binding post plate.</p><p>For a larger speaker with similar design goals look to the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/rinjani\">RINJANI</a> and <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/rinjani-be\">RINJANI Be</a> which are the larger floor standing siblings of the ARA.</p><p>Please see <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}kits/open-source-kits\">Open Source Kits</a> for TeXtreme editions.</p><p><strong>Drivers:</strong></p><ul><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/tw29r-b\">Satori TW29R-B</a></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"{temp}products/mw16p-4\">6½″ Satori MW16P-4</a></p></li></ul>', '49-25000 Hz +/-3dB', '87', '4', '105', '40-150', '3000', 'Bass reflex', '36.5', 'SATORI TW29R-B & 6½″ SATORI MW16P-4', '18 mm MDF', '(HxWxD): 391 x 190 x 388 mm ( 15.4 x 7.48 x 15.27 inch )', 'Cabinet only 8.06 kg ( 17.77 lb ), full assy 9.6 kg ( 21.16 lb )', 'b38f32f9-5f36-4bd3-8c6e-24141ffbb375', '2024-07-18 07:02:28.113', '2025-01-06 04:22:13.829', '', '', '', '', '', '', '', '', '', '');
