('00185df2-865f-4da6-8df1-8ef8b7c0a578', '9e2a9f31-bce3-48ff-b438-0a00f8f8ec0b', 'ROSSO-15SW800', 0, 0, '3aa615e1-7464-49b0-aefe-19cb5ab117df', '2025-09-17 07:01:22.252', '2025-09-18 01:44:23.929', 'Proprietary cone paper material made in-house\nMinimum damping fiber glass voice coil former\n4\" voice coil with APC (Advanced Polymer Coating)\nRibbon voice coil wire for high efficiency\nCast aluminium chassis\nVented pole piece for reduced compression', 'rosso-15sw800', '6b342532-c1fb-4ddb-8b77-6193716f9952', 'admin', '', 0, '', '727918e2-2c44-49b8-8e4c-b90d82407230', '1098ee25-dc58-4c8f-a8b8-3af55fb8727e', 0, '', 0, 0, '', '', '', ''),
('01ff6b88-eeca-4bf3-8cf2-7276fcdd4a2e', '9e2a9f31-bce3-48ff-b438-0a00f8f8ec0b', 'ROSSO-65CD-T', 0, 0, '3aa615e1-7464-49b0-aefe-19cb5ab117df', '2025-09-15 07:49:58.052', '2025-09-18 01:40:12.267', 'Titanium diaphragm\nCopper cap for reduced distortion and extended HF response\nExtended upper frequency response\nAdvanced ferrite motor assembly\nHigh sensitivity and linear frequency response\nAdvanced voice coil with flat copper clad aluminum wire', 'rosso-65cd-t', 'a9bd4892-21c7-4db4-87b2-7ffa6eff5584', 'admin', '', 0, '', '83bb5d87-4f4d-421d-b2ab-59aaa08b00d9', '', 0, '', 0, 0, '', '', '', ''),
('02441977-f5ae-4146-8b01-7e45cff7eefc', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '4\" SB12PACR-00 / Aluminum', 0, 0, 'ee5d459a-eaec-4159-9082-bdbe673a1ea4', '2024-05-03 07:14:40.811', '2025-07-21 01:06:24.560', 'Vented reinforced plastic chassis\nAnodised aluminium cone\nLow damping rubber surround\nLong stroke linear suspension\nEasily adjustable moving mass', 'sb12pacr-00', '3c9856d5-7ff1-4e74-ae83-f176191de196', 'admin', '', 0, '', '', '', 0, '', 0, 0, '', '', '', ''),
