('ff84938f-509f-4173-902e-274da0befd69', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '5\" MR13P-8 / Paper', 0, 0, '5f43323d-d9ed-4688-8e2f-ff5247083128', '2024-05-07 02:56:00.379', '2025-09-08 10:11:04.833', 'Vented aerodynamic cast aluminium chassis for optimum strength and low compression.\nProprietary cone material with EGYPTIAN PAPYRUS™ fibres made in-house.\nSoft low damping rubber surround for optimum transient response.\nAdvanced BIMAX spider for improved linearity.\nPowerful optimized low distortion neodymium motor system.\nNon-conducting fibre glass voice coil former for minimum damping.\nExtended copper sleeve on pole piece for low inductance and reduced distortion.\nCCAW voice coil for reduced moving mass.\nLong life silver lead wires attached 180° apart for improved stability.\nVented pole piece and coil former for reduced compression.\nLow piston to chassis diameter ratio.\nGasket and bolt hole protrusions for reduced coupling to speaker cabinet.', 'mr13p-8', '2c270a3c-3b3d-455b-b5b7-df82a96a077d', 'admin', '', 0, '', '', '', 0, '', 0, 0, '', '', '', ''),
('ffacf733-e64d-4c02-99b8-2f3bc6714ae3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '5\" SB13PFC25-4-COAX / Paper', 0, 0, '5f43323d-d9ed-4688-8e2f-ff5247083128', '2024-05-06 07:12:04.006', '2025-07-21 05:43:05.370', 'Vented reinforced plastic chassis\nProprietary cone material with natural fibers made in-house\nSoft low damping rubber surround for improved transient response\nOptimized motor system\nNon-resonant long life lead wires\nCompact large surround dome tweeter', 'sb13pfc25-4-coax', '23da526d-4ad3-418a-b436-288b952d0467', 'admin', 'd1e6513c-2505-4676-b4f8-5629ede36b44', 1, '', '', '', 0, '', 1, 0, '200', '', '', '');
